import React from 'react';

const inventoryColumns = (onRenderEditableCellHandler) => {
    const columns = 
    [
        {
            Header: 'Product',
            accessor: 'name', // String-based value accessors!
            Cell: onRenderEditableCellHandler
        }, 
        {
            Header: 'Quantity',
            accessor: 'age',
            Cell: onRenderEditableCellHandler // Custom cell components!
        },
        {
            Header: 'Price', // Required because our accessor is not a string
            accessor: 'Friend Name',
            Cell: onRenderEditableCellHandler  // Custom value accessors!
        },
        {
            Header: 'Category',
            accessor: 'age',
            Cell: onRenderEditableCellHandler // Custom cell components!
        }, 
        {
            Header: 'Model',
            accessor: 'age',
            Cell: onRenderEditableCellHandler // Custom cell components!
        }, 
        {
            Header: 'Type', // Required because our accessor is not a string
            accessor: 'Friend Name',
            Cell: onRenderEditableCellHandler  // Custom value accessors!
        }, 
        {
            Header: 'Color',
            accessor: 'age',
            Cell: onRenderEditableCellHandler // Custom cell components!
        },
        {
            Header: 'Condition',
            accessor: 'name', // String-based value accessors!
            Cell: onRenderEditableCellHandler
        }, 
        {
            Header: 'Manufacturer',
            accessor: 'age',
            Cell: onRenderEditableCellHandler // Custom cell components!
        }, 
        {
            Header: 'Cost',
            accessor: 'age',
            Cell: onRenderEditableCellHandler // Custom cell components!
        },
        {
            Header: 'Total Cost',
            accessor: 'age',
            Cell: onRenderEditableCellHandler // Custom cell components!
        }
    ];

    return columns;
};

export default inventoryColumns;
